    false,nt"url": null,nt"notes": "This annual narrative report for Flint
    Hills National Wildlife Refuge and Marais Des Cygnes National Wildlife Refuge summarizes
    refuge activities during the 1999 calendar year.  The report begins with a summary
    of the yearu2019s highlights and climatic conditions.   Land acquisition-including
    fee title, and other is also covered.  The report includes a planning section which
    discusses master plan, management plans, public participation, compliance with environmental
    and cultural resource mandates, and research and investigations.  Refuge administration
    is outlined; information about personnel, youth programs, other, volunteer programs,
    funding, safety, and other items is given.  Habitat management is also covered.
     Subjects include wetlands, forests, cropland, grassland, other habitats, grazing,
    haying, fire management, pest control, and water rights.  The wildlife section of
    the report discusses endangered and/or threatened species, waterfowl, marsh and
    water birds, shorebirds, gulls, terns, and allied species, raptors, other migratory
    birds, game mammals, other residents wildlife, fisheries resources, and scientific
    collections.  The public uses of the refuge described in this report include general,
    outdoor student classrooms, interpretive foot trails, interpretive exhibits/demonstrations,
    other interpretive programs, hunting, fishing, trapping, wildlife observation, other
    wildlife oriented recreation, camping, picnicking, off road vehicling, other non-wildlife
    oriented recreation, and law enforcement.  The equipment and facilities section
    of the report provides information about new construction, rehabilitation, equipment
    utilization and replacement, computer systems, and other.  Items of interest are
    provided at the end.",nt"license_title": "License Not Specified",nt"extras":
